void DigitRec_sw::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"training_set_address0\" :  \"" << training_set_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"training_set_ce0\" :  \"" << training_set_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"training_set_q0\" :  \"" << training_set_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"test_set_address0\" :  \"" << test_set_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"test_set_ce0\" :  \"" << test_set_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"test_set_q0\" :  \"" << test_set_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"results_address0\" :  \"" << results_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"results_ce0\" :  \"" << results_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"results_we0\" :  \"" << results_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"results_d0\" :  \"" << results_d0.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

